import{_ as e,c as r,a0 as a,o as d}from"./chunks/framework.DFDi2gAL.js";const x=JSON.parse('{"title":"Работа с проектами","description":"","frontmatter":{},"headers":[],"relativePath":"doc/projects.md","filePath":"doc/projects.md"}'),n={name:"doc/projects.md"};function l(o,t,s,c,i,p){return d(),r("div",null,t[0]||(t[0]=[a('<h1 id="работа-с-проектами" tabindex="-1">Работа с проектами <a class="header-anchor" href="#работа-с-проектами" aria-label="Permalink to &quot;Работа с проектами&quot;">​</a></h1><h3 id="создание-нового-проекта" tabindex="-1">Создание нового проекта <a class="header-anchor" href="#создание-нового-проекта" aria-label="Permalink to &quot;Создание нового проекта&quot;">​</a></h3><p>Для создания проекта, в левой части страницы «Проекты» введите в текстовое поле название и затем нажмите на кнопку «Добавить проект» (или нажмите клавишу Enter). Имейте ввиду, что максимальная длина имени проекта составляет 32 символа.</p><h3 id="редактирование-проекта" tabindex="-1">Редактирование проекта <a class="header-anchor" href="#редактирование-проекта" aria-label="Permalink to &quot;Редактирование проекта&quot;">​</a></h3><p>Для изменения имени проекта или его позиции в списке, кликните по проекту, чтобы слева от названия появилась кнопка «Редактировать» (иконка карандаша). После нажатия на кнопку «Редактировать», под списком проектов отобразится форма с информацией о проекте. Вы можете сохранить внесенные изменения нажатием на кнопку «Сохранить» (иконка дискеты), либо удалить проект (иконка корзины).</p><p>Обращаем ваше внимание на то, что при удалении проекта будет удалена и вся связанная с ним информация (ссылки, пароли, контакты, задачи) без возможности восстановления.</p><h3 id="работа-с-формами" tabindex="-1">Работа с формами <a class="header-anchor" href="#работа-с-формами" aria-label="Permalink to &quot;Работа с формами&quot;">​</a></h3><p>Справа от списка проектов расположены вкладки с определенными видами информации. Для переключения между ними, нажимайте на кнопки с соответствующим названием (ссылки, пароли, контакты, задачи). (скриншот)</p><p>Вы можете создать до 4 форм в каждой из вкладок (и 8 задач) с бесплатной подпиской, и 64 с Профессиональным планом. Для этого нажмите на кнопку «Добавить форму» (иконка плюса). Отобразиться пустая форма. (скриншот)</p><p>Обращаем ваше внимание, что длина вводимых данных ограничена следующими значениями:</p><table tabindex="0"><thead><tr><th>Название поля</th><th style="text-align:center;">Максимальноеколичество символов</th></tr></thead><tbody><tr><td>Название ссылки</td><td style="text-align:center;">32</td></tr><tr><td>Ссылка</td><td style="text-align:center;">256</td></tr><tr><td></td><td style="text-align:center;"></td></tr><tr><td>Название пароля</td><td style="text-align:center;">32</td></tr><tr><td>Ссылка на авторизацию</td><td style="text-align:center;">256</td></tr><tr><td>Логин</td><td style="text-align:center;">64</td></tr><tr><td>Пароль</td><td style="text-align:center;">32</td></tr><tr><td></td><td style="text-align:center;"></td></tr><tr><td>Имя контакта</td><td style="text-align:center;">32</td></tr><tr><td>Поле контакта</td><td style="text-align:center;">64</td></tr><tr><td></td><td style="text-align:center;"></td></tr><tr><td>Задача и подзадача</td><td style="text-align:center;">128</td></tr></tbody></table><p>Информация в формах сохраняется автоматически при потере фокуса вводимого поля.</p><p>Для удаления формы, нажмите на кнопку «Удалить форму» (иконка корзины). (скриншот)</p>',13)]))}const y=e(n,[["render",l]]);export{x as __pageData,y as default};
